import {DataProvider} from './components/Context'



class App extends React.Component{
  render(){
    return(
      <DataProvider>
        <div className="app">
          <Router>
            <Navbar />
            <Banner/>
            {/* <Section /> */}
          </Router>
        </div>
      </DataProvider>
    );
  }
}

export default App;
